// This is a comment

// think of a 'class' as a template
class Post {

	// the order of the items in the constructor is the order
	// in which data will be assigned

	constructor(
				title,
				link,
				author,
				img,
				body){
					this.title = title;
					this.link = link;
					this.author = author;
					this.img = img;
					this.body = body;
	}
}

const app = new Vue({

	// this is the HTML element that the app will operate from
	el: '#root',

	// this is the data elements that feed the app
	data: {

		// this is what the search is looking for
		// the default value is an empty string
		keyword: '',

		// this is an array of items that will be
		// interpreted by the Post class
		postlist: [
			// constructed Post item
			new Post(
			    'First Post: YEEEEEE',
			 	// this is the TITLE place in the class
				'http://store.nike.com/us/en_us/pw/mens-kobe-bryant/7puZa9h',	// this is the LINK place in the class
				'An Author',			// this is the AUTHOR place in the class
				'http://1.bp.blogspot.com/-1mHUrnFHCxw/Ud0I-4dgnrI/AAAAAAAAAcM/Vx94gz8_lyY/s1600/Nike+KD+V+Elite+Basketball+Shoe.jpg',	// this is the IMAGE place in the class
				'yes.' // this is the BODY place in the class
				),

			new Post(
				'Second Post: Stuff',
				'http://tse1.mm.bing.net/th?id=OIP.bQQKlwKp5fUSt_oQ8nRkagE2DJ&pid=15.1',
				'Aaron Author',
				'http://images.nike.com/is/image/DotCom/PDP_HERO_S/852425_107_A_PREM/kobe-ad-mens-basketball-shoe.jpg', // this is a local image in the same folder as the js script
				' Shoes are good. '
				),

			new Post(
				'This Post: Dat Boi',
				'http://store.nike.com/us/en_us/pd/kobe-ad-mens-basketball-shoe/pid-11391292/pgid-11455498',
				'Bob Author',
				'http://tse2.mm.bing.net/th?id=OIP.luIRf7n2Pu-D-qZjdGRY0QEsDh&pid=15.1',
				'do it for Allah.'
				),

			new Post(
				'Another Post: Yes',
				'data:image/jpeg;base64,',
				'Jamie Author',
				'data:image/jpeg;base64,',
				'The warriors are going to sweep the Caveliers.'
				),

			new Post(
				'Last Post: Lakabo',
				'http://tse1.mm.bing.net/th?id=OIP.OlrwRsqHLhe68wLMcbYRmAEsDI&w=270&h=180&c=7&qlt=90&o=4&pid=1.7',
				'Alex Author',
				'http://tse2.mm.bing.net/th?id=OIP.O-McCKoSa_fMe6X_HKYqdQEsDH&w=221&h=160&c=7&qlt=90&o=4&pid=1.7',
				'Maxx needs to stop.'
				)
		]
	},

	// computed properties are functions
	// that work on the data they receive
	computed: {

		// this defines the search function
		filterlist(){

			// filterlist object
			// returns a filter funtion over the constructed post
			return this.postlist.filter((post)=>{

				// of an inculded array of title-toLowerCase matching any keyword-toLowerCase returned
				return post.title.toLowerCase().includes(this.keyword.toLowerCase());
			});
		}
	}

});



